svg.script:
  function init(evt) {
    if ( window.svgDocument == null ) {
      svgDoc = evt.target.ownerDocument;
    }
  }

  function colourCanton(canton_name, colour)
  {
	var canton = svgDocument.getElementById(canton_name);
	canton.setAttributeNS(null, 'style', 'fill:'+ colour);
  }


  function displayName(canton_name)
  {
    svgDocument.getElementById('canton_name').firstChild.data = canton_name;
  }
